import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './css/bootstrap.css'; 
import './css/main/main.css'; 
import './css/colors.css'; 
import './css/responsive.css'; 
import './././style.css'; 

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
